import { CircularProgressbar, buildStyles } from "react-circular-progressbar";
import "react-circular-progressbar/dist/styles.css";

const blue = "#59afff"

export default function DoroTimer() {

  return (
    <div>
      <CircularProgressbar
        value={50}
        text={`${50}`}
        styles={buildStyles({
          textColor: "#fff",
          pathColor: "#0091ff",
          trailColor:""
        })}
      />
    </div>
  );
}
